import { updateObject } from '../../Shared/Utility';
import * as actionTypes from '../action/actionTypes';

const initialState = {
    innovation: null
};

const authStart = ( state, action ) => {
    return updateObject( state, { aboutus: action.name} );
};

const reducer = ( state = initialState, action ) => {
    switch ( action.type ) {
        case actionTypes.INNOVATION_START: return innovation(state, action);
        default:
            return state;
    }
};

export default reducer;
